let rememberReds = []

// functions

const addToCol = (title, text)=>{
	const file = doc(db, "USERS", 'users collections')
	const col = collection(file, `${auth.currentUser.email}`)
	addDoc(col, {
		title: title,
		text: text,
		createdAt: serverTimestamp(),
		pickedWords: rememberReds
	})
}



function clearAny(e) {
	const main = e.target.closest('body')
	main.querySelector('.input__textarea').value = ''
	main.querySelector('.input__wrapped-area').innerHTML = ''
	main.querySelector('.save-text-popup__input').value = ''
	rememberReds = []
	main.querySelector('.translated__area').innerHTML = `Список слов, <br/> которые ты хочешь <br/> выучить,  с <br/> переводом`
	main.querySelector('.input__wrapped-area').classList.remove('open')
